    def test_bad_link(self):
        with self.assertRaises(requests.exceptions.ConnectionError) as e:
            get_json_response('https://ickasdasd.com/')

    def test_timeout_link(self):
        with self.assertRaises(requests.exceptions.ConnectTimeout) as e:
            get_json_response('https://vk.com/')

    def test_404_link(self):
        with self.assertRaises(requests.exceptions.HTTPError) as e:
            get_json_response('https://www.pipsnacks.com/404')


